import FeaturedNews from './app/componets/Screens/FeaturedNews/FeaturedNewss';
import Home from './app/componets/Screens/FeaturedNews/Home';
import AppNavigaion from './app/componets/Screens/FeaturedNews/AppNavigaion';

const Stack = createStackNavigator();

export default class App extends React.Component{
  render(){
    return(
      <View style={styles.container}>
        <NavigationContainer>
          <Stack.Navigator>
          <Stack.Screen name="Home" component={Home} />
          <Stack.Screen name="NewsPost" component={NewsPost} />
          </Stack.Navigator>
        </NavigationContainer>
      </View>
    )
  }
}

